      birth: null,
      description:
        '<h2>Appearance and Personality</h2><p>Old Man Zangetsu (Yhwach)</p><figure data-align="right" data-img-src="https://static.comicvine.com/uploads/original/6/63278/1246088-zangetsu4ig9.jpg" data-ref-id="1300-1246088" data-size="medium" data-embed-type="image" data-ratio="1.3138173302108"><a class="fluid-height" style="padding-bottom:131.4%" href="https://static.comicvine.com/uploads/original/6/63278/1246088-zangetsu4ig9.jpg" data-ref-id="1300-1246088"><img alt="Zangetsu" src="https://comicvine1.cbsistatic.com/uploads/original/6/63278/1246088-zangetsu4ig9.jpg" srcset="https://comicvine1.cbsistatic.com/uploads/original/6/63278/1246088-zangetsu4ig9.jpg 427w" sizes="(max-width: 427px) 100vw, 427px" data-width="427"></a><figcaption>Zangetsu</figcaption></figure><p>This embodiment was first believed to be that of <a href="//www.comicvine.com/ichigo-kurosaki/4005-42468/" data-ref-id="4005-42468">Ichigo</a>\'s zapakuto, Zangetsu. It was recently discovered by Ichigo, however that this manifestation is actually the embodiment of Ichigo\'s <a href="/quincy/4060-59703/" data-ref-id="4060-59703">Quincy</a> powers, taking the form of <a href="//www.comicvine.com/yhwach/4005-85518/" data-ref-id="4005-85518">Yhwach</a>, the Quincy King as he looked one thousand years ago, and not of his Zanpakuto. He impersonated Zangetsu in order to suppress Ichigo\'s Shinigami powers and hinder him from becoming a Shinigami. He states that if it happened, Ichigo would eventually die by his very hands. He even went so far as to be Ichigo\'s primary source of power. However, in time as Yhwach watched Ichigo through the many battles, pain, suffering and experiences, his heart began to waver. He eventually changes his mind, wanting to help Ichigo and watch him succeed. He tells him that the power he\'s been wielding up to that point, was only a portion of his powers. Yhwach decides to relinquish his hold on Ichigo and states that the time has finally come for the latter to fight with his own, true power. Yhwach\'s form dissipates and a glowing zanpakuto appears in his place. He tells Ichigo to take it for it is his true Zanpakuto.</p><p>He looks to be a man somewhere in his late thirties to mid forties. He has long, black hair and scruffy-looking stubble on his face. Yhwach wears semi-transparent sunglasses and a long black coat/cape with a string connecting the shoulder and the lapel.</p><p>As far as his personality goes, he is serene and straight forward. His actions speak for themselves and he speaks only when he he feels it is necessary. Most of the time, he is Ichigo\'s voice of reason. He is also a strong, capable and formidable combatant, not to be taken lightly. Yhwach resides within Ichigo\'s inner world (mind), a place that is completely sideways, from the clouds in the sky to the buildings and skyscrapers in the fore and background.</p><p> </p><p> </p><h3>Tensa Zangetsu</h3><figure data-align="right" data-img-src="https://static.comicvine.com/uploads/original/6/63278/1274136-tensa_zangetsu.jpg" data-ref-id="1300-1274136" data-size="medium" data-embed-type="image" data-ratio="1.0592503022975"><a class="fluid-height" style="padding-bottom:105.9%" href="https://static.comicvine.com/uploads/original/6/63278/1274136-tensa_zangetsu.jpg" data-ref-id="1300-1274136"><img alt="Tensa Zangetsu" src="https://comicvine1.cbsistatic.com/uploads/original/6/63278/1274136-tensa_zangetsu.jpg" srcset="https://comicvine1.cbsistatic.com/uploads/original/6/63278/1274136-tensa_zangetsu.jpg 827w" sizes="(max-width: 906px) 100vw, 906px" data-width="906"></a><figcaption>Tensa Zangetsu</figcaption></figure><p>He is the embodiment of Ichigo\'s bankai. <em>Tensa Zangetsu </em>looks to be a young man in his late teens to mid twenties. He wears a black-hooded cloak and brandishes Ichigo\'s bankai-transformed Zanpakuto. In order to learn the "Final Getsuga Tensho", Ichigo must face him in combat while in a water-submerged version of his inner world.</p><p> </p><h3>"Tensa Zangetsu Prime" (Official Name Not Given)</h3><p> </p><figure data-align="left" data-img-src="https://static.comicvine.com/uploads/original/5/57845/1291323-source.jpg" data-ref-id="1300-1291323" data-size="medium" data-embed-type="image" data-ratio="0.82307692307692"><a class="fluid-height" style="padding-bottom:82.3%" href="https://static.comicvine.com/uploads/original/5/57845/1291323-source.jpg" data-ref-id="1300-1291323"><img alt=" "Zangetsu Prime"" src="data:image/gif;base64,R0lGODlhAQABAAAAACH5BAEKAAEALAAAAAABAAEAAAICTAEAOw==" sizes="(max-width: 480px) 100vw, 480px" data-width="480" class="js-lazy-load-image" data-src="https://comicvine1.cbsistatic.com/uploads/scale_medium/5/57845/1291323-source.jpg" data-srcset="https://comicvine1.cbsistatic.com/uploads/original/5/57845/1291323-source.jpg 520w, https://comicvine1.cbsistatic.com/uploads/scale_medium/5/57845/1291323-source.jpg 480w"><noscript><img alt=" "></noscript></a><figcaption> "Zangetsu Prime"</figcaption></figure><p>The yet-to-be-officially-named "Tensa Zangetsu Prime" is the end result of Tensa Zangetsu\'s merger with the latest incarnation of Ichigo\'s Inner Hollow. "Prime" is also the true embodiment of Ichigo\'s powers. It is this being, not Tensa nor Hollow Ichigo, that Ichigo must face in combat in order to learn and master the Final Getsuga Tenshou.</p><p> </p><p> </p><h2>Major Story Arcs</h2><p> </p><p> </p><p> </p><h2>Powers &amp; Abilities</h2><h2>Other Media</h2>',
