      birth: null,
      description:
        '<h2>Origin</h2><p>The origin of this specific character is not specified by the creator and remains unknown.</p><h2>Creation</h2><p>Old Man Mozz was created by <a href="/lee-falk/4040-56162/" data-ref-id="4040-56162">Lee Falk</a>.</p><h2>Character Evolution</h2><p>He is the wise old man in the Pygmy Bandar tribe who is said to be many years old. He is very much known for telling stories of <a href="/the-phantom/4005-7957/" data-ref-id="4005-7957">The Phantom</a>\'s ancestors. While his stories keep the young children entertained, they also sometimes serve as great advisory examples to the current <a href="/phantom/4050-33273/" data-ref-id="4050-33273">Phantom</a> of 21st century.</p><p>It is said that his knowledge is to a level that he knows almost entirely the chronicles of <a href="/the-phantom/4005-7957/" data-ref-id="4005-7957">The Phantom</a>\'s ancestors. Many a times it is seen that the current Phantom, unable to find an answer in Skull Cave\'s chronicles, consults with the old man to understand how earlier Phantom would react or solve if presented with a similar trouble that he is facing now.</p><p>Old Man Mozz is said to know the history of the jungle, the tribes that lived before, those that have come into existence now, tribal wars and much much more. He always has answers to the questions that The Phantom or any pygmy tribe mate may have and always presents an example from the past by telling it "as it is". He is often found quoting "<a href="/the-phantom/4005-7957/" data-ref-id="4005-7957">The Phantom</a>" as a very interesting personality passing the responsibilities from one generation to the other without fail.</p>',
