        '<p> </p><h2>Origin</h2><h2>Creation</h2><p>Rolling Logan (ローリング・ローガン, Rōringu Rōgan) is a supporting character in the <a href="https://www.comicvine.com/one-piece/4050-21397/" data-ref-id="4050-21397"><i>One Piece</i></a> series that was created by <a href="https://www.comicvine.com/eiichiro-oda/4040-55855/" data-ref-id="4040-55855">Eiichiro Oda</a>. The series first began serialization in <a href="https://www.comicvine.com/shueisha/4010-1867/" data-ref-id="4010-1867">Shueisha\'s</a> <a href="https://www.comicvine.com/weekly-shonen-jump/4050-43519/" data-ref-id="4050-43519"><i>Weekly Shōnen Jump</i></a> on August 4, 1997. He would later appear in the <i>Dressrosa Arc</i> that began in Volume ??.</p><p>His first appearance was in <i>One Piece</i> Volume ?? CH. 706 <i>"</i><i>I Ain\'t Gonna Laugh at Ya"</i>.</p><h2>Major Story Arcs</h2><h3>Dressrosa Arc</h3><h2>Powers &amp; Abilities</h2>',
