      description:
        '<h2>Origin</h2><p>Jeremy Logan worked as a night clerk in a cheap hotel in a small town in <a data-ref-id="4020-55740" href="/florida/4020-55740/" slug="florida">Florida</a>. One night a guest registered under the name <a data-ref-id="4005-1472" href="/captain-marvel/4005-1472/" slug="captain-marvel">C. Marvel</a> and Logan soon found himself in the middle of a battle between two long feuding alien races.</p><h2>Creation</h2><p>Jeremy Logan was created by writer <a data-ref-id="4040-40467" href="/stan-lee/4040-40467/" slug="stan-lee">Stan Lee</a> and artist <a data-ref-id="4040-3792" href="/gene-colan/4040-3792/" slug="gene-colan">Gene Colan</a> in 1967.</p><h2>Major Story Arcs</h2><p>Jeremy Logan was always suspicious of the name one of his guests had used to register at the hotel where he was a night clerk. One day Logan received a call from General "Old Man" Bridges from <a data-ref-id="4020-57868" href="/cape-military-base/4020-57868/" slug="cape-military-base">The Cape</a> military base asking for Walter Lawson. When Logan realised the General meant "C. Marvel", he decided to check things out for himself. Once Mar-Vell had left his room, Logan let himself in to look for clues, thinking Lawson/C. Marvel must be an enemy spy or else why would he use a fake name. Logan found Captain Mar-Vel\'s carry all cylinder and while trying to pry it open inadvertently set off a timer counting down to a nuclear explosion. Ignorant about the imminent danger, Logan drives off with the case to see General Bridges and inform him Lawson is a fake. Unfortunately for the patriotic clerk, he drives across the path of the <a data-ref-id="4005-21332" href="/super-skrull/4005-21332/" slug="super-skrull">Super Skrull</a>. Logan is instantly attacked and finds out both Mar-Vell and the Skrull are aliens before the latter throws him off a mountain ledge. Logan is saved by Captain Mar-Vell only to be knocked unconscious and eventually ending up in hospital.</p><p>Logan had fallen into a coma and a few days later is visited by Mar-Vell who uses a Kree memory erasing machine to make him forget about the last seven days. Logan\'s unlucky streak continues because during Captain Marvel\'s visit, the hero is attacked by The Metazoid who destroys the entire hospital room. Jeremy Logan eventually makes a full recover and returns to his night shift, none the wiser bout Mar-Vell\'s true identity.</p>',
