      description:
        '<h2>Origin<br/></h2>Leaper Logan escaped from the Springdale Maximum Security Prison when he built a hovering device in the prison\'s machine shop. Logan wanted the police and the media to look like fools and he started stealing numerous items that started with the letters that spelled Leaper. Leaper Logan would come into conflict with <a data-ref-id="4005-2104" href="/robbie-baldwin/4005-2104/" slug="robbie-baldwin">        Robbie Baldwin</a> as the <a data-ref-id="4005-2104" href="/robbie-baldwin/4005-2104/" slug="robbie-baldwin">       Masked Marvel</a> when he stole a punjab pendant from his mother, <a data-ref-id="4005-25665" href="/maddie-baldwin/4005-25665/" slug="maddie-baldwin">      Maddie Baldwin</a>. The Masked Marvel was having a hard time controlling his direction during the fight and Leaper Logan was able to escape by scaling a building with his suction pads. Robbie found a list that his father compiled of Logan\'s crimes and discovered that he was spelling his name with the crimes he was committing. Logan\'s next move had to do something with the letter R and the Masked Marvel intercepted Leaper Logan at the Hammond Museum when he stole a Roman coin collection. The Masked Marvel chased Leaper Logan all over town until the leaping criminal landed in front of a cop named Burnatt who was the first officer to ever bust Logan. Leaper Logan was arrested and placed behind bars.   <br/><h2>Creation<br/></h2>Leaper Logan was created by <a data-ref-id="4040-41502" href="/roger-stern/4040-41502/" slug="roger-stern">   Roger Stern</a> and <a data-ref-id="4040-4026" href="/steve-ditko/4040-4026/" slug="steve-ditko">  Steve Ditko</a> in 1988 and first appeared in <a data-ref-id="4050-4073" href="/speedball/4050-4073/" slug="speedball"> Speedball</a> # 3.   <br/><h2>Story Arcs<br/></h2>A resident of Springdale named Clyde broke free a    number of Speedball\'s former foes from jail including <a href="../../sticker/29-38730/" rel="nofollow ">               Sticker</a>, <a href="../../bug-eyed-voice/29-42993/" rel="nofollow ">                          Bug-Eyed Voice</a>, <a href="../../the-ghost-of-springdale-hill/29-4820/" rel="nofollow ">                        Ghost of Springdale High</a>, <a href="../../bonehead/29-4819/" rel="nofollow ">                        Bonehead</a>,               Leaper  Logan, the            <a data-ref-id="4005-14526" href="/the-basher/4005-14526/" slug="the-basher">          Basher</a>, <a href="../../two-legged-rat/29-31942/" rel="nofollow ">                     Two-Legged  Rat</a> and the <a href="../../harlequin-hitman/29-24012/" rel="nofollow ">                  Harlequin  Hit Man</a> to form the <a href="../../speedball-revenge-squad/65-48329/" rel="nofollow ">                   Speedball Revenge Squad</a>. Clyde wanted the  squad to capture <a href="../../niels/29-48176/" rel="nofollow ">                Niels</a>  and <a href="../../robbie-baldwin/29-2104/" rel="nofollow ">               Speedball</a>  for one of his greatest experiments. Harlequin shot  Niels  the cat but  it was protected from the kinetic field surrounding  the  feline. However  the cat was propelled forward and its body hit the   Sticker and the  feline was unable to escape. Speedball would come  into  conflict with the  Revenge Squad at the Hammonds Research Center  but he  was taken out by  Clyde\'s gas gun. Clyde was planning to drain  the  kinetic energy from  Speedball and Niels but they were able to  escape  from their shackles  when the cat coughed up a hairball that  took down  the entire Revenge  Squad. Clyde, Leaper Logan and the rest of  the Speedball Revenge  Squad was defeated and  placed into police  custody.    <br/><h2>Abilities &amp; Paraphernalia<br/></h2>Leaper Logan created numerous gadgets including a hovering device and a suit that provided him great leaping ability through his boots. His suit was also equipped with suction pads that allowed him to scale buildings.',
